import React from 'react';
import Hero from '../components/Hero';
import Banner from '../components/banner';
import {Link} from 'react-router-dom';

const Room = () => {
    return ( 
        <Hero hero="roomsHero">
           <Banner title="Rooms available for you">
               <Link to="/" className="btn-primary">
                    Home
               </Link>
           </Banner>
        </Hero>
    )
}

export default Room;
